import React from "react";
import { Route, Routes } from "react-router-dom";
import Home from "./components/Home";
import Blog from "./components/Blog";

const App: React.FC = () => {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/blog" element={<Blog />} />
      </Routes>
    </div>
  );
};

export default App;
